import Footer from "./components/Footer";
import HomePage from "./components/HomePage";
import { Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <TopBar />

      <HomePage />

      <Footer />
    </div>
  );
}

export default App;
